import React from 'react'
import { Outlet } from "react-router-dom";
import AdminNavbar from '../component/AdminNavbar';
import Footer from '../component/Footer';
function AdminLayout(pro) {
    return (
        <>
             <AdminNavbar />
            <Outlet />
            <Footer/>
        </>
    )
}

export default AdminLayout
